app.use('/', publicRouter);
app.use('/api', apiRouter);

apiRouter.use('/users', userRouter);
apiRouter.use('/pictures', pictureRouter);
apiRouter.get('/health', (req, res) => {
  res.status(200).json({
    apiStatus: "Healthy!"
  })
})

export default app;

